import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div id="WatchListContainer">
        <div id="WatchList"></div>
        <div id="FormContainer">
          <h1>New Ticker</h1>
          <input></input>
        </div>
      </div>
      <div id="StockDisplay"></div>
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
